const videos = [
    {
        name: 'RON', 
        id:1,
        photo: <img src = "src/img/photo1"></img>,
    },
    {
        name: 'KOTVANOGD', 
        id:2,
        photo: <img src = "src/img/photo1"></img>,
    },
    {
        name: 'Pro100 Roma', 
        id:3,
        photo: <img src = "src/img/photo1"></img>,
    }
]

export function VideoList(){
    return (
        <>
            <h1>Video List</h1>
            {
                videos.map((video) => {
                    return (
                        <div key={video.id}>
                            <p>{video.name}</p>
                            <img>{video.photo}</img>
                            <button>Like!</button>
                        </div>
                    )
                })
            }
        </>
        
    )
}
